import React from "react";

export default function TextForm(props) {
  return (
    <div className="container py-5">
      <h2>{props.Heading}</h2>
      <div className="mb-3">
        <label for="mytextarea" className="form-label">
          Example textarea
        </label>
        <textarea className="form-control" id="mytextarea" rows="10"></textarea>
      </div>
    </div>
  );
}
